import React from 'react'
import "../App.css"
import {Link} from 'react-router-dom'

export default function AllList(props) {
  return (
    <div id="grid">
        {props.user.map((value, index) => {
          return (
            <>
              <div className="gridDiv" Link to>
                <h4>{value.name}</h4>
                <h5>{value.uid}</h5>
              </div>
            </>
          );
        })}
      </div>
  )
}
